"use client";

import React from "react";
import SidebarLayout from "../../components/SidebarLayout";
import { jsPDF } from "jspdf";

const PdfGenerator = () => {
    const generatePdf = (nombrePaciente, edadPaciente, mediciones, datos) => {
        const doc = new jsPDF("p", "mm", "a4");
        
        const addImages = () => {
            const logoNutrina = "data:image/png;base64,"; // Reemplaza con tu logo en base64
            const logoConsultorio = "data:image/png;base64,"; // Reemplaza con tu logo en base64
            doc.addImage(logoNutrina, "PNG", 10, 10, 30, 30); // Logo izquierdo
            doc.addImage(logoConsultorio, "PNG", 170, 10, 30, 30); // Logo derecho
        };


        // Configuracin de la tabla
        const startX = 10;
        const startY = 60;
        const rowHeight = 10;
        const columnWidth = 25;
        const totalMediciones = 6; // Nmero de mediciones por pgina
        const indicadores = [
            "Fecha", "T/A mm Hg", "Glucemia Capilar", "Peso (kg)", "Estatura (cm)",
            "Cintura (cm)", "Cadera (cm)", "ICC", "% Grasa", "Kg grasa", "Grasa visceral",
            "% Msculo", "Kg msculo", "Edad Corporal", "IMC", "CMB"
        ];

        // Funcin para dibujar encabezado y datos del paciente
        const drawHeader = () => {
            // Encabezado
            doc.setFont("helvetica", "bold");
            doc.setFontSize(12);
            doc.text("L.N Monserrat Pia Jimnez", 60, 20);
            doc.setFont("helvetica", "normal");
            doc.text("Cdula Profesional: 12490409 UAE/Mx", 60, 25);
            doc.text("CONSULTORIO NUTRICIONAL", 60, 30);

            // Informacin del paciente
            doc.text(`Nombre del paciente: ${nombrePaciente || "___________________________"}`, 10, 50);
            doc.text(`Edad: ${edadPaciente || "_______"}`, 160, 50);
        };

        // Funcin para dibujar la tabla
        const drawTable = (pageData) => {
            const startYTable = startY;
            const columnWidth = 25;
            const rowHeight = 10;
            
            // Encabezados de las mediciones
            mediciones.forEach((medicion, i) => {
                const x = startX + columnWidth + i * columnWidth;
                doc.setFont("helvetica", "bold");
                doc.text(medicion, x + 2, startYTable - 2);
                doc.rect(x, startYTable, columnWidth, rowHeight); // Borde del encabezado
            });

            // Dibujar las filas con los indicadores
            indicadores.forEach((indicador, rowIndex) => {
                const y = startYTable + (rowIndex + 1) * rowHeight;

                // Ajustar texto largo de indicadores
                const words = doc.splitTextToSize(indicador, columnWidth - 2);
                words.forEach((word, i) => {
                    doc.setFont("helvetica", "normal");
                    doc.text(word, startX + 2, y - 6 + i * 4);
                });
                doc.rect(startX, y, columnWidth, rowHeight); // Borde del indicador

                // Dibujar los datos para cada medicin
                for (let colIndex = 0; colIndex < mediciones.length; colIndex++) {
                    const dato = pageData[colIndex]?.[rowIndex] || ""; // Valor o vaco
                    const x = startX + columnWidth + colIndex * columnWidth;
                    doc.text(dato, x + 2, y - 2);
                    doc.rect(x, y, columnWidth, rowHeight); // Borde del dato
                }
            });
        };

        // Divisin de los datos en varias pginas (si hay ms de 6 mediciones)
        const chunks = [];
        for (let i = 0; i < datos.length; i += totalMediciones) {
            chunks.push(datos.slice(i, i + totalMediciones));
        }

        // Dibujar las pginas
        chunks.forEach((pageData, pageIndex) => {
            if (pageIndex > 0) {
                doc.addPage(); // Agregar una nueva pgina
            }

            // Agregar imgenes en cada pgina
            addImages();

            // Dibujar encabezado en cada pgina
            drawHeader();

            // Dibujar la tabla en cada pgina
            drawTable(pageData);
        });

        // Parmetros de referencia (debajo de la tabla)
        const referenceY = startY + (indicadores.length + 1) * rowHeight + 10;
        doc.setFont("helvetica", "bold");
        doc.text("PARMETROS DE REFERENCIA", 10, referenceY);
        doc.setFont("helvetica", "normal");
        doc.text("Femenina 20-39 aos", 10, referenceY + 5);
        doc.text("Grasa Corporal: 21 - 32.9", 10, referenceY + 10);
        doc.text("Grasa Visceral: 1 - 9", 10, referenceY + 15);
        doc.text("IMC: 18.5 - 24.9", 10, referenceY + 20);
        doc.text("ICC: < 0.80", 10, referenceY + 25);

        // Guardar el PDF
        doc.save("molde-nutrina.pdf");
    };

    // Ejemplo de uso
    const nombrePaciente = "Juan Prez";
    const edadPaciente = "30 aos";

    // Mediciones y datos dinmicos
    const mediciones = ["1 medicin", "2 medicin", "3 medicin", "4 medicin", "5 medicin", "6 medicin"];
    const datos = [
        ["2024-01-01", "120/80", "90", "65", "1.70", "70", "100", "0.7", "25", "20", "5", "45", "30", "25", "22", "25", "25"],
        ["2024-02-01", "110/70", "85", "64", "1.70", "68", "98", "0.69", "24", "19", "4", "46", "31", "26", "21", "24", "24"],
        ["2024-03-01", "130/85", "95", "66", "1.71", "72", "102", "0.75", "27", "21", "6", "47", "32", "28", "23", "26", "26"],
        ["2024-04-01", "125/80", "88", "67", "1.72", "74", "104", "0.73", "26", "22", "5", "48", "33", "29", "24", "27", "27"],
        ["2024-05-01", "115/75", "87", "68", "1.73", "75", "106", "0.72", "26", "23", "5", "49", "34", "30", "25", "28", "28"],
        ["2024-06-01", "120/78", "90", "69", "1.74", "76", "108", "0.74", "28", "24", "6", "50", "35", "31", "26", "29", "29"],
        ["2024-07-01", "110/70", "85", "70", "1.75", "78", "110", "0.76", "25", "25", "5", "51", "36", "32", "27", "30", "30"],
        ["2024-08-01", "118/74", "92", "72", "1.76", "79", "112", "0.77", "27", "26", "6", "52", "37", "33", "28", "31", "31"]
    ];

    return (
        <SidebarLayout>
            <div>
                <button onClick={() => generatePdf(nombrePaciente, edadPaciente, mediciones, datos)}>Descargar PDF</button>
            </div>
        </SidebarLayout>
    );
};

export default PdfGenerator;
